import React from 'react';
import * as FaIcons from 'react-icons/fa';
import * as AiIcons from 'react-icons/ai';
import * as IoIcons from 'react-icons/io';

export const SidebarData = [
  {
    title: 'Home',
    path: '/',
    icon: <AiIcons.AiFillHome />,
    cName: 'nav-text'
  },
  {
    title: 'Your Researches',
    path: '/reports',
    children:[
      {
        title:'Completed',
        path:'/',
        icon:<IoIcons.IoIosDoneAll/>,
        cName: 'nav-text'
      },
      {
        title:'Pending',
        path:'/',
        icon:<AiIcons.AiOutlineQuestion/>,
        cName: 'nav-text'
      }
    ],
    icon: <IoIcons.IoMdPhotos />,
    cName: 'nav-text'
  },
  {
    title: 'Saved',
    path: '/reports',
    children:[
      {
        title:'Completed',
        path:'/',
        icon:<IoIcons.IoIosDoneAll/>,
        cName: 'nav-text'
      },
      {
        title:'Pending',
        path:'/',
        icon:<IoIcons.IoSaveOutline/>,
        cName: 'nav-text'
      }
    ],
    icon: <IoIcons.IoMdPhotos />,
    cName: 'nav-text'
  },
  {
    title: 'Team',
    path: '/team',
    icon: <IoIcons.IoMdPeople />,
    cName: 'nav-text'
  },
  {
    title: 'Messages',
    path: '/messages',
    icon: <FaIcons.FaEnvelopeOpenText />,
    cName: 'nav-text'
  },
  {
    title: 'Support',
    path: '/support',
    icon: <IoIcons.IoMdHelpCircle />,
    cName: 'nav-text'
  }
];
